import React from 'react';
import TextField from '@material-ui/core/TextField';


export default class Cards extends React.Component {
    constructor(props){ 
        super(props) 
        this.state = {
        name : '',
        type : '',
        price: '',
        rating : '',
        years : '',
        available : false,
     }
    }
    handleChange(e){
      e.preventDefault();
      this.setState({
        [e.target.name]: e.target.value
      })
    }
    render() {
        const { name, type, price, rating, years, available } = this.state
        return (
          <form noValidate autoComplete="off">
            <TextField
              id="standard-name"
              label="Model"

              value={name}
              onChange={this.handleChange}
              margin="normal"
            />
            <TextField
              id="standard-name"
              label="type"

              value={type}
              onChange={this.handleChange}
              margin="normal"
            />
             <TextField
            id="standard-number"
            label="Price"
            value={price}
            onChange={this.handleChange}
            type="number"
            InputLabelProps={{
            shrink: true,
            }}
            margin="normal"
             />
            <TextField
            id="standard-number"
            label="Rating"
            value={rating}
            onChange={this.handleChange}
            type="number"
            InputLabelProps={{
            shrink: true,
            }}
            margin="normal"
            />
             <TextField
            id="standard-number"
            label="Years"
            value={years}
            onChange={this.handleChange}
            type="number"
            InputLabelProps={{
            shrink: true,
            }}
            margin="normal"
            />
            </form>
          );
        }        
    }
